import React, { Component } from "react";
import Login from "./components/login";
import './App.css';

class App extends Component {
  render(){
  return (
    <div className="App">
      <header className="App-header">
        Login
      </header>
      <main className="buttons">
      <Login/>>
      </main>
    </div>
  );
  }
}

export default App;
